import React from 'react';
import '../css/ExamCard.css';

function ExamCard(props) {
  return (
      <div className='exam-card'>
          <h3>Admin Information</h3>
          <h3 className='first-name'>{props.firstName}</h3>
      </div>
  );
}

export default ExamCard;
